function Modal({ show }) {
  if (!show) return;
  return (
    <div>
      <div>X</div>
      <table>
        <tbody>
          <thead>
            <th>Name:</th>
            <th>Email:</th>
            <th>Password:</th>
          </thead>
          <tr>
            <td>subhan</td>
            <td>subhan@gmail.com</td>
            <td>921296</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default Modal;
